class Hello extends Component {

	componentDidMount() {
		fetch('http://snapi.epitech.eu.')
		.then(res => res.json())
		.then((data) => {
			console.log(data);
		})
		.catch(console.log);
	}
	render(){
  return (
    <div className="Content">
      <h1> Hello </h1>
    </div>
  );
}
}
export default Hello;
